import { RECEIVE_SELECTED_ASSET } from "./asset.actions";
const INITIAL_STATE  = {    
  state: {},
  assetID: null,
  assetName: null,
  assetSerial: null,
  assetImage: null,
  assetStatus:null,
}

// eslint-disable-next-line import/no-anonymous-default-export
export default (state = INITIAL_STATE , { type, assetData }) => {
  switch (type) {
    case RECEIVE_SELECTED_ASSET:
      return assetData;
    default:
      return state;
  }
};
// export default assetData;
